import { useParams } from "react-router-dom";
import { getMovie } from "../../api/movies";
import { useQuery } from "react-query";

const Movie = () => {
  const { movieId } = useParams();
  const { status, data} = useQuery(
    ["movie", movieId],
    () => getMovie(movieId)
  );

 console.log(data);

  return  (
    <div>
      <h1>Movie details</h1>
      <h2>{data.title}</h2>
    </div>
  );
};

export default Movie;
